import React from 'react';

const Nweet = (props) => {
  return (
    <div key={props.nweetObj.id}>
      <h4>{props.nweetObj.text}</h4>
      {props.isOwner ? <button>Delete Nweet</button> : null}
      <button>Edit Nweet</button>
    </div>
  );
};

export default Nweet;
